      {
        name: 'Using props to pass data',
        exercises: 7
      },
      {
        name: 'State of a component',
        exercises: 14
      }
    ]
  }

  const Header = (props) =>{
    return (
      <div>
        <h1>{props.name}</h1>

      </div>
    )
  }

  const Content = (props) => {
      return (
        <div>
          <Part course={props.name} ex={props.exercises}/>
          <Part course={props.name} ex={props.exercises}/>
          <Part course={props.name} ex={props.exercises}/>
        </div>
      )
  }

