    return (
      <div>
        <p>{props.course} {props.ex}</p>
      </div>
    )
  }

  const Total = (props) => {
    return (
      <div>
        <p>{props.exercises + props.exercises + props.exercises}</p>
      </div>
    )
  }

  return (
    <div>
      <Header course={course}/>
      <Content parts={course}/>
      <Total parts={course}/>
    </div>
  )
}

export default App
